export default function works(state=[],action){
    switch(action.type){
        case "WORKS_CONTENT_DATA_SUCCESS":
           for (let i in action.payload){
               state=[...state,action.payload[i]]
           }
            console.log(state)
            return action.payload;
        default:
            return state
    }
}
